l.Country))\r\n        {\r\n            employeeModel.Country = null;\r\n        }\r\n        else\r\n        {\r\n            employeeModel.Country = employeeModel.Country.Trim();\r\n            if (!wordPattern.IsMatch(employeeModel.Country) || employeeModel.Country.Length \u003E 50)\r\n            {\r\n                throw new ArgumentException(nameof(employeeModel.Country));\r\n            }\r\n        }\r\n\r\n        if (string.IsNullOrWhiteSpace(employeeModel.City))\r\n        {\r\n            employeeModel.City = null;\r\n        }\r\n        else\r\n        {\r\n            employeeModel.City = employeeModel.City.Trim();\r\n            if (!wordPattern.IsMatch(employeeModel.City) || employeeModel.City.Length \u003E 50)\r\n            {\r\n                throw new ArgumentException(nameof(employeeModel.City));\r\n            }\r\n        }\r\n\r\n        if (string.IsNullOrWhiteSpace(employeeModel.Address))\r\n        {\r\n            employeeModel.Address = null;\r\n        }\r\n        else\r\n        {\r\n            employeeModel.Address = employeeModel.Address.Trim();\r\n            if (employeeModel.Address.Length \u003E 50)\r\n            {\r\n                throw new ArgumentException(nameof(employeeModel.City));\r\n            }\r\n        }\r\n\r\n        if (string.IsNullOrWhiteSpace(employeeModel.Phone))\r\n        {\r\n            employeeModel.Phone = null;\r\n        }\r\n        else\r\n        {\r\n            employeeModel.Phone = employeeModel.Phone.Trim();\r\n\r\n            if (!employeeModel.Phone.StartsWith(\u0027\u002B\u0027))\r\n            {\r\n                employeeModel.Phone = employeeModel.Phone.Insert(0, \u0022\u002B\u0022);\r\n            }\r\n\r\n            if (!phonePattern.IsMatch(employeeModel.Phone))\r\n            {\r\n                throw new ArgumentException(nameof(employeeModel.Phone));\r\n            }\r\n        }\r\n\r\n        if (employeeModel.HireDate \u003C= employeeModel.BirthDate || employeeModel.Hire auctionRepository = Substitute.For\u003CIAuctionRepository\u003E();\r\n        _database.Auctions.Returns(_auctionRepository);\r\n        _mapper = Substitute.For\u003CIMapper\u003E();\r\n        _service = new AuctionService(_database, _mapper);\r\n    }\r\n\r\n    [Fact]\r\n    public void GetAuction_PassingInvalidId_ThrowsInvalidIdException()\r\n    {\r\n        // Arrange\r\n        var invalidId = 0;\r\n\r\n        // Act \u0026 Assert\r\n        Assert.Throws\u003CInvalidIdException\u003E(() =\u003E _service.GetAuction(invalidId));\r\n    }\r\n\r\n    [Fact]\r\n    public void GetAuction_AuctionNotFound_ThrowsInvalidIdException()\r\n    {\r\n        // Arrange\r\n        var id = 1;\r\n        _auctionRepository.Get(id).Returns((Auction)null);\r\n\r\n        // Act \u0026 Assert\r\n        Assert.Throws\u003CInvalidIdException\u003E(() =\u003E _service.GetAuction(id));\r\n    }\r\n\r\n    [Fact]\r\n    public void GetAuction_ValidId_ReturnsMappedAuctionDTO()\r\n    {\r\n        // Arrange\r\n        var id = 1;\r\n        var auction = new Auction { ID = id };\r\n        var expectedDto = new AuctionDTO();\r\n        _auctionRepository.Get(id).Returns(auction);\r\n        _mapper.Map\u003CAuctionDTO\u003E(auction).Returns(expectedDto);\r\n\r\n        // Act\r\n        var result = _service.GetAuction(id);\r\n\r\n        // Assert\r\n        Assert.Same(expectedDto, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void GetAuctions_WhenCalled_ReturnsMappedCollection()\r\n    {\r\n        // Arrange\r\n        var auctions = new List\u003CAuction\u003E { new Auction() };\r\n        var expectedDtos = new List\u003CAuctionDTO\u003E { new AuctionDTO() };\r\n        _auctionRepository.GetAll().Returns(auctions);\r\n        _mapper.Map\u003CIEnumerable\u003CAuction\u003E, IEnumerable\u003CAuctionDTO\u003E\u003E(auctions).Returns(expectedDtos);\r\n\r\n        // Act\r\n        var result = _service.GetAuctions();\r\n\r\n        // Assert\r\n        Assert.Same(expectedDtos, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void OpenAuction_PassingInvalidId_ThrowsInvalidIdException()\r\n    {\r\n        // Arrange\r\n        var invalidId = 0;\r\n\r\n        // Act \u0026 Assert\r\n        Assert.Throws\u003CInvalidIdException\u003E(() =\u003E _service.OpenAuction(invalidId));\r\n    }\r\n\r\n    [Fact]\r\n    public void OpenAuction_AuctionNotFound_ThrowsInvalidIdException()\r\n    {\r\n        // Arrange\r\n        var id = 1;\r\n        _auctionRepository.Get(id).Returns((Auction)null);\r\n\r\n        // Act \u0026 Assert\r\n        Assert.Throws\u003CInvalidIdException\u003E(() =\u003E _service.OpenAuction(id));\r\n    }\r\n\r\n    [Fact]\r\n    public void OpenAuction_AuctionEnded_ThrowsInvalidAuctionException()\r\n    {\r\n        // Arrange\r\n        var id = 1;\r\n        var endedAuction = new Auction { ID = id, Ended = true };\r\n        _auctionRepository.Get(id).Returns(endedAuction);\r\n\r\n        // Act \u0026 Assert\r\n        var ex = Assert.Throws\u003CInvalidAuctionException\u003E(() =\u003E _service.OpenAuction(id));\r\n        Assert.Equal(\u0022ERROR: Auction has already finished\u0022, ex.Message);\r\n    }\r\n\r\n    [Fact]\r\n    public void OpenAuction_AuctionAlreadyStarted_ThrowsInvalidAuctionException()\r\n    {\r\n        // Arrange\r\n        var id = 1;\r\n        var startedAuction = new Auction { ID = id, Started = true };\r\n        _auctionRepository.Get(id).Returns(startedAuction);\r\n\r\n        // Act \u0026 Assert\r\n        var ex = Assert.Throws\u003CInvalidAuctionException\u003E(() =\u003E _service.OpenAuction(id));\r\n        Assert.Equal(\u0022ERROR: Auction has already started\u0022, ex.Message);\r\n    }\r\n\r\n    [Fact]\r\n    public void OpenAuction_ValidState_OpensAuctionAndCommits()\r\n    {\r\n        // Arrange\r\n        var id = 1;\r\n        var auction = new Auction { ID = id, Started = false, Ended = false };\r\n        _auctionRepository.Get(id).Returns(auction);\r\n\r\n        // Act\r\n        _service.OpenAuction(id);\r\n\r\n        // Assert\r\n        Assert.True(auction.Started);\r\n        _auctionRepository.Received(1).Update(auction);\r\n        _database.Received(1).Commit();\r\n    }\r\n\r\n    [Fact]\r\n    public void CloseAuction_PassingInvalidId_ThrowsInvalidIdException()\r\n    {\r\n        // Arrange\r\n        var invalidId = 0;\r\n\r\n        // Act \u0026 Assert\r\n        Assert.Throws\u003CInvalidIdException\u003E(() =\u003E _service.CloseAuction(invalidId));\r\n    }\r\n\r\n    [Fact]\r\n    public void CloseAuction_AuctionNotFound_ThrowsInvalidIdException()\r\n    {\r\n        // Arrange\r\n        var id = 1;\r\n        _auctionRepository.Get(id).Returns((Auction)null);\r\n\r\n        // Act \u0026 Assert\r\n        Assert.Throws\u003CInvalidIdException\u003E(() =\u003E _service.CloseAuction(id));\r\n    }\r\n\r\n    [Fact]\r\n    public void CloseAuction_AuctionNotStarted_ThrowsInvalidAuctionException()\r\n    {\r\n        // Arrange\r\n        var id = 1;\r\n        var auction = new Auction { ID = id, Started = false };\r\n        _auctionRepository.Get(id).Returns(auction);\r\n\r\n        // Act \u0026 Assert\r\n        var ex = Assert.Throws\u003CInvalidAuctionException\u003E(() =\u003E _service.CloseAuction(id));\r\n        Assert.Equal(\u0022ERROR: Auction has not started yet\u0022, ex.Message);\r\n    }\r\n\r\n    [Fact]\r\n    public void CloseAuction_AuctionAlreadyEnded_ThrowsInvalidAuctionException()\r\n    {\r\n        // Arrange\r\n        var id = 1;\r\n        var auction = new Auction { ID = id, Started = true, Ended = true };\r\n        _auctionRepository.Get(id).Returns(auction);\r\n\r\n        // Act \u0026 Assert\r\n        var ex = Assert.Throws\u003CInvalidAuctionException\u003E(() =\u003E _service.CloseAuction(id));\r\n        Assert.Equal(\u0022ERROR: Auction has already finished\u0022, ex.Message);\r\n    }\r\n\r\n    [Fact]\r\n    public void CloseAuction_ValidState_ClosesAuctionAndCommits()\r\n    {\r\n        // Arrange\r\n        var id = 1;\r\n        var auction = new Auction { ID = id, Started = true, Ended = false };\r\n        _auctionRepository.Get(id).Returns(auction);\r\n\r\n        // Act\r\n        _service.CloseAuction(id);\r\n\r\n        // Assert\r\n        Assert.True(auction.Ended);\r\n        _auctionRepository.Received(1).Update(auction);\r\n        _database.Received(1).Commit();\r\n    }\r\n\r\n    [Fact]\r\n    public void Bet_PassingInvalidId_ThrowsInvalidIdException()\r\n    {\r\n        // Arrange\r\n        var invalidId = 0;\r\n        var customerName = \u0022Customer\u0022;\r\n        var bid = 100;\r\n\r\n        // Act \u0026 Assert\r\n        Assert.Throws\u003CInvalidIdException\u003E(() =\u003E _service.Bet(invalidId, customerName, bid));\r\n    }\r\n\r\n    [Fact]\r\n    public void Bet_PassingNullCustomerName_ThrowsInvalidNameException()\r\n    {\r\n        // Arrange\r\n        var id = 1;\r\n        string customerName = null;\r\n        var bid = 100;\r\n\r\n        // Act \u0026 Assert\r\n        Assert.Throws\u003CInvalidNameException\u003E(() =\u003E _service.Bet(id, customerName, bid));\r\n    }\r\n\r\n    [Fact]\r\n    public void Bet_AuctionNotFound_ThrowsInvalidIdException()\r\n    {\r\n        // Arrange\r\n        var id = 1;\r\n        var customerName = \u0022Customer\u0022;\r\n        var bid = 100;\r\n        _auctionRepository.Get(id).Returns((Auction)null);\r\n\r\n        // Act \u0026 Assert\r\n        Assert.Throws\u003CInvalidIdException\u003E(() =\u003E _service.Bet(id, customerName, bid));\r\n    }\r\n\r\n    [Fact]\r\n    public void Bet_AuctionNotStarted_ThrowsInvalidAuctionException()\r\n    {\r\n        // Arrange\r\n        var id = 1;\r\n        var customerName = \u0022Customer\u0022;\r\n        var bid = 100;\r\n        var auction = new Auction { ID = id, Started = false };\r\n        _auctionRepository.Get(id).Returns(auction);\r\n\r\n        // Act \u0026 Assert\r\n (auction);\r\n        _database.Received(1).Commit();\r\n    }\r\n}\r\n","tests":[{"id":"4dc76d05-6fec-6280-5192-9674f84c7031","name":"DeepSeekR10528UnitTests.AuctionServiceTests.GetAuction_PassingInvalidId_ThrowsInvalidIdException","location":{"start":{"line":23,"column":5},"end":{"line":31,"column":6}}},{"id":"9a3b9a59-f7d9-fe9d-c4a1-31404204276e","name":"DeepSeekR10528UnitTests.AuctionServiceTests.GetAuction_AuctionNotFound_ThrowsInvalidIdException","location":{"start":{"line":33,"column":5},"end":{"line":42,"column":6}}},{"id":"a4badb08-bd58-722b-9b32-c3d0a44dda15","name":"DeepSeekR10528UnitTests.AuctionServiceTests.GetAuction_ValidId_ReturnsMappedAuctionDTO","location":{"start":{"line":44,"column":5},"end":{"line":59,"column":6}}},{"id":"d5b9e16f-eeca-d2e5-98f4-b6597c286d3c","name":"DeepSeekR10528UnitTests.AuctionServiceTests.GetAuctions_WhenCalled_ReturnsMappedCollection","location":{"start":{"line":61,"column":5},"end":{"line":75,"column":6}}},{"id":"4bf0caa2-9a29-5fbd-d17e-9fe9421c4554","name":"DeepSeekR10528UnitTests.AuctionServiceTests.OpenAuction_PassingInvalidId_ThrowsInvalidIdException","location":{"start":{"line":77,"column":5},"end":{"line":85,"column":6}}},{"id":"f7afeb5e-d5e5-6194-ed3a-ef8d854d9776","name":"DeepSeekR10528UnitTests.AuctionServiceTests.OpenAuction_AuctionNotFound_ThrowsInvalidIdException","location":{"start":{"line":87,"column":5},"end":{"line":96,"column":6}}},{"id":"6b0768ba-b466-71f2-fa70-7700bcec2c51","name":"DeepSeekR10528UnitTests.AuctionServiceTests.OpenAuction_AuctionEnded_ThrowsInvalidAuctionException","location":{"start":{"line":98,"column":5},"end":{"line":109,"column":6}}},{"id":"d3c27388-3f11-a5ec-d975-4b2e37201674","name":"DeepSeekR10528UnitTests.AuctionServiceTests.OpenAuction_AuctionAlreadyStarted_ThrowsInvalidAuctionException","location":{"start":{"line":111,"column":5},"end":{"line":122,"column":6}}},{"id":"6d1bde65-3412-0ee6-2fa1-bf49b4a71264","name":"DeepSeekR10528UnitTests.AuctionServiceTests.OpenAuction_ValidStat l(1, s[1, 2]);\r\n    }\r\n\r\n    [Fact]\r\n    public void MatrixChainOrder_ThreeMatrices_Returns7500AndSetsSCorrectly()\r\n    {\r\n        // Arrange\r\n        int[] p = { 10, 100, 5, 50 };\r\n        int n = 4;\r\n\r\n        // Act\r\n        int cost = MatrixChainMultiplication.MatrixChainOrder(p, n, out int[,] s);\r\n\r\n        // Assert\r\n        Assert.Equal(7500, cost);\r\n        Assert.NotNull(s);\r\n        Assert.Equal(4, s.GetLength(0));\r\n        Assert.Equal(4, s.GetLength(1));\r\n        Assert.Equal(1, s[1, 2]);\r\n        Assert.Equal(2, s[2, 3]);\r\n        Assert.Equal(2, s[1, 3]);\r\n    }\r\n\r\n    [Fact]\r\n    public void GetOptimalParentheses_SingleMatrix_ReturnsA1()\r\n    {\r\n        // Arrange\r\n        int[,] s = new int[2, 2];\r\n        int i = 1;\r\n        int j = 1;\r\n\r\n        // Act\r\n        string result = MatrixChainMultiplication.GetOptimalParentheses(s, i, j);\r\n\r\n        // Assert\r\n        Assert.Equal(\u0022A1\u0022, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void GetOptimalParentheses_TwoMatrices_ReturnsParenthesesCorrectly()\r\n    {\r\n        // Arrange\r\n        int[,] s = new int[3, 3];\r\n        s[1, 2] = 1;\r\n        int i = 1;\r\n        int j = 2;\r\n\r\n        // Act\r\n        string result = MatrixChainMultiplication.GetOptimalParentheses(s, i, j);\r\n\r\n        // Assert\r\n        Assert.Equal(\u0022(A1A2)\u0022, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void GetOptimalParentheses_ThreeMatricesSplitAtTwo_ReturnsDoubleParenthesized()\r\n    {\r\n        // Arrange\r\n        int[,] s = new int[4, 4];\r\n        s[1, 2] = 1;\r\n        s[1, 3] = 2;\r\n        int i = 1;\r\n        int j = 3;\r\n\r\n        // Act\r\n        string result = MatrixChainMultiplication.GetOptimalParentheses(s, i, j);\r\n\r\n        // Assert\r\n        Assert.Equal(\u0022((A1A2)A3)\u0022, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void GetOptimalParentheses_ThreeMatricesSplitAtOne_ReturnsAlternateParenthesization()\r\n    {\r\n        // Arrange\r\n        int[,] s = new int[4, 4];\r\n        s[2, 3] = 2;\r\n        s[1, 3] = 1;\r\n        int i = 1;\r\n        int j = 3;\r\n\r\n        // Act\r\n        string result = MatrixChainMultiplication.GetOptimalParentheses(s, i, j);\r\n\r\n        // Assert\r\n        Assert.Equal(\u0022(A1(A2A3))\u0022, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void CombinedMethods_ThreeMatrices_CorrectCostAndParentheses()\r\n    {\r\n        // Arrange\r\n        int[] p = { 10, 100, 5, 50 };\r\n        int n = 4;\r\n\r\n        // Act\r\n        int cost = MatrixChainMultiplication.MatrixChainOrder(p, n, out int[,] s);\r\n        string parentheses = MatrixChainMultiplication.GetOptimalParentheses(s, 1, n - 1);\r\n\r\n        // Assert\r\n        Assert.Equal(7500, cost);\r\n        Assert.Equal(\u0022((A1A2)A3)\u0022, parentheses);\r\n    }\r\n\r\n    [Fact]\r\n    public void CombinedMethods_TwoMatrices_CorrectCostAndParentheses()\r\n    {\r\n        // Arrange\r\n        int[] p = { 10, 20, 30 };\r\n        int n = 3;\r\n\r\n        // Act\r\n        int cost = MatrixChainMultiplication.MatrixChainOrder(p, n, out int[,] s);\r\n        string parentheses = MatrixChainMultiplication.GetOptimalParentheses(s, 1, n - 1);\r\n\r\n        // Assert\r\n        Assert.Equal(6000, cost);\r\n        Assert.Equal(\u0022(A1A2)\u0022, parentheses);\r\n    }\r\n}\r\n","tests":[{"id":"2b2272e3-2054-4614-2e04-0a2b0e057993","name":"DeepSeekR10528UnitTests.MatrixChainMultiplicationTests.MatrixChainOrder_OneMatrix_ReturnsZero","location":{"start":{"line":7,"column":5},"end":{"line":22,"column":6}}},{"id":"6e06b25a-fcc7-d0f7-d548-3b12a79c069e","name":"DeepSeekR10528UnitTests.MatrixChainMultiplicationTests.MatrixChainOrder_TwoMatrices_Returns6000","location":{"start":{"line":24,"column":5},"end":{"line":40,"column":6}}},{"id":"67ed8f4b-f250-7e4e-ffde-40a771e8a550","name":"DeepSeekR10528UnitTests.MatrixChainMultiplicationTests.MatrixChainOrder_ThreeMatrices_Returns7500AndSetsSCorrectly","location":{"start":{"line":42,"column":5},"end":{"line":60,"column":6}}},{"id":"58ab462e-8b6c-7545-8987-318d504d7b5b","name":"DeepSeekR10528UnitTests.MatrixChainMultiplicationTests.GetOptimalParentheses_SingleMatrix_ReturnsA1","location":{"start":{"line":62,"column":5},"end":{"line":75,"column":6}}},{"id":"dcc3546c-e609-c594-b134-daf6d1b5a3d5","name":"DeepSeekR10528UnitTests.MatrixChainMultiplicationTests.GetOptimalParentheses_TwoMatrices_ReturnsParenthesesCorrectly","location":{"start":{"line":77,"column":5},"end":{"line":91,"column":6}}},{"id":"cb1349eb-4bbb-8abf-16e1-8378c98ff616","name":"DeepSeekR10528UnitTests.MatrixChainMultiplicationTests.GetOptimalParentheses_ThreeMatricesSplitAtTwo_ReturnsDoubleParenthesized","location":{"start":{"line":93,"column":5},"end":{"line":108,"column":6}}},{"id":"c5dec530-92e3-10a6-33c1-f3686a7a7a8b","name":"DeepSeekR10528UnitTests.MatrixChainMultiplicationTests.GetOptimalParentheses_ThreeMatricesSplitAtOne_ReturnsAlternateParenthesization","location":{"start":{"line":110,"column":5},"end":{"line":125,"column":6}}},{"id":"d6a66c9a-0ea3-16c7-5d5b-9d2cb5254939","name":"DeepSeekR10528UnitTests.MatrixChainMultiplicationTests.CombinedMethods_ThreeMatrices_CorrectCostAndParentheses","location":{"start":{"line":127,"column":5},"end":{"line":141,"column":6}}},{"id":"9b42efc0-58b9-8e16-bfd1-523b8c95ea7a","name":"DeepSeekR10528UnitTests.MatrixChainMultiplicationTests.CombinedMethods_TwoMatrices_CorrectCostAndParentheses","location":{"start":{"line":143,"column":5},"end":{"line":157,"column":6}}}]},"D:\\Programming\\Projects\\LlmUnitTestGenerationArtifacts\\DeepSeekR10528UnitTests\\Sample12Tests.cs":{"language":"cs","source":"using Dataset.Sample12;\r\n\r\nnamespace DeepSeekR10528UnitTests\r\n{\r\n    public class LUPDecompositionTests\r\n    {\r\n        private void AssertMatricesEqual(double[,] expected, double[,] actual, int precision = 5)\r\n        {\r\n            int rowExpected = expected.GetLength(0);\r\n            int colExpected = expected.GetLength(1);\r\n            int rowActual = actual.GetLength(0);\r\n            int colActual = actual.GetLength(1);\r\n            Assert.Equal(rowExpected, rowActual);\r\n            Assert.Equal(colExpected, colActual);\r\n\r\n            for (int i = 0; i \u003C rowExpected; i\u002B\u002B)\r\n            {\r\n                for (int j = 0; j \u003C colExpected; j\u002B\u002B)\r\n                {\r\n                    Assert.Equal(expected[i, j], actual[i, j], precision);\r\n                }\r\n            }\r\n        }\r\n\r\n        private double[,] ApplyPermutation(double[,] matrix, int[] p)\r\n        {\r\n            int n = matrix.GetLength(0);\r\n            int m = matrix.GetLength(1);\r\n            double[,] result = new double[n, m];\r\n            for (int i = 0; i \u003C n; i\u002B\u002B)\r\n            {\r\n                int originalRow = p[i];\r\n                for (int j = 0; j \u003C m; j\u002B\u002B)\r\n                {\r\n                    result[i, j] = matrix[originalRow, j];\r\n                }\r\n            }\r\n            return result;\r\n        }\r\n\r\n        private double[,] MultiplyMatrices(double[,] a, double[,] b)\r\n        {\r\n            int aRows = a.GetLength(0);\r\n            int aCols = a.GetLength(1);\r\n            int bRows = b.GetLength(0);\r\n            int bCols = b.GetLength(1);\r\n            if (aCols != bRows)\r\n                throw new ArgumentException(\u0022Invalid matrix dimensions for multiplication\u0022);\r\n\r\n            double[,] result = new double[aRows, bCols];\r\n            for (int i = 0; i \u003C aRows; i\u002B\u002B)\r\n            {\r\n                for (int j = 0; j \u003C bCols; j\u002B\u002B)\r\n                {\r\n                    double sum = 0;\r\n                    for (int k = 0; k \u003C aCols; k\u002B\u002B)\r\n                    {\r\n                        sum \u002B= a[i, k] * b[k, j];\r\n                    }\r\n                    result[i, j] = sum;\r\n                }\r\n            }\r\n            return result;\r\n        }\r\n\r\n        [Fact]\r\n        public void Decompose_1x1NonSingular_ReturnsCorrectLU()\r\n        {\r\n            // Arrange\r\n            double[,] original = { { 5 } };\r\n            double[,] input = (double[,])original.Clone();\r\n            double[,] L, U;\r\n            int[] P;\r\n\r\n            // Act\r\n            LUPDecomposition.Decompose(input, out L, out U, out P);\r\n\r\n            // Assert\r\n            double[,] expectedL = { { 1 } };\r\n            double[,] expectedU = { { 5 } };\r\n            int[] expectedP = { 0 };\r\n\r\n            AssertMatricesEqual(expectedL, L);\r\n            AssertMatricesEqual(expectedU, U);\r\n            Assert.Equal(expectedP, P);\r\n        }\r\n\r\n        [Fact]\r\n        public void Decompose_3x3NonSingular_ReturnsExpectedLandUAndP()\r\n        {\r\n            // Arrange\r\n            double[,] original = {\r\n                { 2, 1, 1 },\r\n                { 4, 3, 3 },\r\n                { 8, 7, 9 }\r\n            };\r\n            double[,] input = (double[,])original.Clone();\r\n            double[,] L, U;\r\n            int[] P;\r\n\r\n            // Act\r\n            LUPDecomposition.Decompose(input, out L, out U, out P);\r\n\r\n            // Assert\r\n            double[,] expectedL = {\r\n                { 1, 0, 0 },\r\n                { 0.5, 1, 0 },\r\n                { 0.25, 1.5, 1 }\r\n            };\r\n            double[,] expectedU = {\r\n                { 8, 7, 9 },\r\n                { 0, -0.5, -1.5 },\r\n                { 0, 0, 1 }\r\n            };\r\n            int[] expectedP = { 2, 1, 0 };\r\n\r\n            AssertMatricesEqual(expectedL, L, 5);\r\n            AssertMatricesEqual(expectedU, U, 5);\r\n            Assert.Equal(expectedP, P);\r\n\r\n            double[,] A_permuted = ApplyPermutation(original, P);\r\n NotEmptyVector_ReturnsEqualArray()\r\n    {\r\n        // Arrange\r\n        double[] vector = { 1.1, 2.2, 3.3 };\r\n\r\n        // Act\r\n        var result = vector.Copy();\r\n\r\n        // Assert\r\n        Assert.Equal(vector, result);\r\n        Assert.NotSame(vector, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void Copy_EmptyVector_ReturnsEmptyArray()\r\n    {\r\n        // Arrange\r\n        double[] vector = Array.Empty\u003Cdouble\u003E();\r\n\r\n        // Act\r\n        var result = vector.Copy();\r\n\r\n        // Assert\r\n        Assert.Empty(result);\r\n    }\r\n\r\n    [Fact]\r\n    public void OuterProduct_TwoVectors_CorrectMatrixResult()\r\n    {\r\n        // Arrange\r\n        double[] lhs = { 1, 2 };\r\n        double[] rhs = { 3, 4 };\r\n        double[,] expected = { { 3, 4 }, { 6, 8 } };\r\n\r\n        // Act\r\n        var result = lhs.OuterProduct(rhs);\r\n\r\n        // Assert\r\n        Assert.Equal(expected, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void OuterProduct_OneEmptyVector_ReturnsEmptyMatrix()\r\n    {\r\n        // Arrange\r\n        double[] lhs = { 1, 2 };\r\n        double[] rhs = Array.Empty\u003Cdouble\u003E();\r\n        var expected = new double[2,0];\r\n\r\n        // Act\r\n        var result = lhs.OuterProduct(rhs);\r\n\r\n        // Assert\r\n        Assert.Equal(expected.GetLength(0), result.GetLength(0));\r\n        Assert.Equal(expected.GetLength(1), result.GetLength(1));\r\n    }\r\n\r\n    [Theory]\r\n    [InlineData(new double[] { 1, 2 }, new double[] { 3, 4 }, 11)]\r\n    [InlineData(new double[] { -1, 0, 1 }, new double[] { 2, 3, 4 }, 2)]\r\n    public void Dot_EqualLengthVectors_CorrectResult(double[] lhs, double[] rhs, double expected)\r\n    {\r\n        // Arrange \u0026 Act\r\n        var result = lhs.Dot(rhs);\r\n\r\n        // Assert\r\n        Assert.Equal(expected, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void Dot_DifferentLengthVectors_ThrowsArgumentException()\r\n    {\r\n        // Arrange\r\n        double[] lhs = { 1, 2 };\r\n        double[] rhs = { 1 };\r\n\r\n        // Act \u0026 Assert\r\n        Assert.Throws\u003CArgumentException\u003E(() =\u003E lhs.Dot(rhs));\r\n    }\r\n\r\n    [Fact]\r\n    public void Dot_EmptyVectors_ReturnsZero()\r\n    {\r\n        // Arrange\r\n        double[] lhs = Array.Empty\u003Cdouble\u003E();\r\n        double[] rhs = Array.Empty\u003Cdouble\u003E();\r\n\r\n        // Act\r\n        var result = lhs.Dot(rhs);\r\n\r\n        // Assert\r\n        Assert.Equal(0, result);\r\n    }\r\n\r\n    [Theory]\r\n    [InlineData(new double[] { 3, 4 }, 5)]\r\n    [InlineData(new double[] { 1, 1, 1, 1 }, 2)]\r\n    [InlineData(new double[] { 0, 0 }, 0)]\r\n    public void Magnitude_VariousVectors_CorrectResult(double[] vector, double expected)\r\n    {\r\n        // Arrange \u0026 Act\r\n        var result = vector.Magnitude();\r\n\r\n        // Assert\r\n        Assert.Equal(expected, result);\r\n    }\r\n\r\n    [Theory]\r\n    [InlineData(new double[] { 1, 2, 3 }, 2, new double[] { 2, 4, 6 })]\r\n    [InlineData(new double[] { 0, 1, 0 }, 5, new double[] { 0, 5, 0 })]\r\n    [InlineData(new double[] { }, 10, new double[] { })]\r\n    public void Scale_VariousVectors_CorrectResult(double[] vector, double factor, double[] expected)\r\n    {\r\n        // Arrange \u0026 Act\r\n        var result = vector.Scale(factor);\r\n\r\n        // Assert\r\n        Assert.Equal(expected, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void ToColumnVector_NonEmptyVector_CorrectMatrix()\r\n    {\r\n        // Arrange\r\n        double[] vector = { 1, 2, 3 };\r\n        double[,] expected = { { 1 }, { 2 }, { 3 } };\r\n\r\n        // Act\r\n        var result = vector.ToColumnVector();\r\n\r\n        // Assert\r\n        Assert.Equal(expected, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void ToColumnVector_EmptyVector_CorrectMatrix()\r\n    {\r\n        // Arrange\r\n        double[] vector = Array.Empty\u003Cdouble\u003E();\r\n        double[,] expected = new double[0, 1];\r\n\r\n        // Act\r\n        var result = vector.ToColumnVector();\r\n\r\n        // Assert\r\n        Assert.Equal(expected.GetLength(0), result.GetLength(0));\r\n        Assert.Equal(1, result.GetLength(1));\r\n    }\r\n\r\n    [Fact]\r\n    public void ToRowVector_ColumnVector_CorrectArray()\r\n    {\r\n        // Arrange\r\n        double[,] vector = { { 1 }, { 2 }, { 3 } };\r\n        double[] expected = { 1, 2, 3 };\r\n\r\n        // Act\r\n        var result = vector.ToRowVector();\r\n\r\n        // Assert\r\n        Assert.Equal(expected, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void ToRowVector_NonColumnVector_ThrowsInvalidOperationException()\r\n    {\r\n        // Arrange\r\n        double[,] invalidVector = new double[2, 2];\r\n\r\n        // Act \u0026 Assert\r\n        Assert.Throws\u003CInvalidOperationException\u003E(() =\u003E invalidVector.ToRowVector());\r\n    }\r\n\r\n    [Fact]\r\n    public void ToRowVector_EmptyColumnVector_ReturnsEmptyArray()\r\n    {\r\n        // Arrange\r\n        double[,] emptyVector = new double[0, 1];\r\n        double[] expected = Array.Empty\u003Cdouble\u003E();\r\n\r\n        // Act\r\n        var result = emptyVector.ToRowVector();\r\n\r\n        // Assert\r\n        Assert.Equal(expected, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void ToDiagonalMatrix_NonEmptyVector_CorrectMatrix()\r\n    {\r\n        // Arrange\r\n        double[] vector = { 1, 2, 3 };\r\n        double[,] expected = {\r\n            { 1, 0, 0 },\r\n            { 0, 2, 0 },\r\n            { 0, 0, 3 }\r\n        };\r\n\r\n        // Act\r\n        var result = vector.ToDiagonalMatrix();\r\n\r\n        // Assert\r\n        for (int i = 0; i \u003C vector.Length; i\u002B\u002B)\r\n        {\r\n            for (int j = 0; j \u003C vector.Length; j\u002B\u002B)\r\n            {\r\n                Assert.Equal(expected[i, j], result[i, j]);\r\n            }\r\n        }\ d by InlineData\r\n\r\n        // Act\r\n        var result = CaesarEncoder.Encode(input, key);\r\n\r\n        // Assert\r\n        Assert.Equal(expected, result);\r\n    }\r\n\r\n    [Theory]\r\n    [InlineData(\u0022Khoor, Zruog!\u0022, 3, \u0022Hello, World!\u0022)]\r\n    [InlineData(\u0022Hello, World!\u0022, 0, \u0022Hello, World!\u0022)]\r\n    [InlineData(\u0022Hello, World!\u0022, 26, \u0022Hello, World!\u0022)]\r\n    [InlineData(\u0022CDE\u0022, 5, \u0022XYZ\u0022)]\r\n    [InlineData(\u0022zab\u0022, -1, \u0022abc\u0022)]\r\n    [InlineData(\u0022dEf\u0022, 3, \u0022aBc\u0022)]\r\n    public void Decode_ValidInputs_ExpectedDecoding(string input, int key, string expected)\r\n    {\r\n        // Arrange\r\n        // Inputs provided by InlineData\r\n\r\n        // Act\r\n        var result = CaesarEncoder.Decode(input, key);\r\n\r\n        // Assert\r\n        Assert.Equal(expected, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void EncodeAndDecode_RoundTrip_ReturnsOriginalText()\r\n    {\r\n        // Arrange\r\n        var original = \u0022The Quick Brown Fox Jumps Over The Lazy Dog! 123\u0022;\r\n        var key = 7;\r\n\r\n        // Act\r\n        var encoded = CaesarEncoder.Encode(original, key);\r\n        var decoded = CaesarEncoder.Decode(encoded, key);\r\n\r\n        // Assert\r\n        Assert.Equal(original, decoded);\r\n    }\r\n\r\n    [Fact]\r\n    public void Encode_WithNullText_ThrowsNullReferenceException()\r\n    {\r\n        // Arrange\r\n        string input = null;\r\n        int key = 5;\r\n\r\n        // Act \u0026 Assert\r\n        Assert.Throws\u003CNullReferenceException\u003E(() =\u003E CaesarEncoder.Encode(input, key));\r\n    }\r\n\r\n    [Fact]\r\n    public void Decode_WithNullText_ThrowsNullReferenceException()\r\n    {\r\n        // Arrange\r\n        string input = null;\r\n        int key = 5;\r\n\r\n        // Act \u0026 Assert\r\n        Assert.Throws\u003CNullReferenceException\u003E(() =\u003E CaesarEncoder.Decode(input, key));\r\n    }\r\n\r\n    [Fact]\r\n    public void Encode_WithNegativeBeyond26_WrapsCorrectly()\r\n    {\r\n        // Arrange\r\n        var input = \u0022abc\u0022;\r\n        int key = -30; // Equivalent to -4 mod 26 \u2192 22 (since 26 * 2 = 52, -30 mod 26 is 22: -30 \u002B 26*2 = 22)\r\n        string expected = \u0022wxy\u0022; // a shifted back by 4 (a-\u003Ez, y, x, w) \u2192 becomes w\r\n\r\n        // Act\r\n        var result = CaesarEncoder.Encode(input, key);\r\n\r\n        // Assert\r\n        Assert.Equal(expected, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void Encode_AllCharactersInAlphabet_Uppercase()\r\n    {\r\n        // Arrange\r\n        var input = \u0022ABCDEFGHIJKLMNOPQRSTUVWXYZ\u0022;\r\n        int key = 13;\r\n        string expected = \u0022NOPQRSTUVWXYZABCDEFGHIJKLM\u0022;\r\n\r\n        // Act\r\n        var result = CaesarEncoder.Encode(input, key);\r\n\r\n        // Assert\r\n        Assert.Equal(expected, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void Encode_AllCharactersInAlphabet_Lowercase()\r\n    {\r\n        // Arrange\r\n        var input = \u0022abcdefghijklmnopqrstuvwxyz\u0022;\r\n        int key = 13;\r\n        string expected = \u0022nopqrstuvwxyzabcdefghijklm\u0022;\r\n\r\n        // Act\r\n        var result = CaesarEncoder.Encode(input, key);\r\n\r\n        // Assert\r\n        Assert.Equal(expected, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void Decode_AllCharactersInAlphabet_Uppercase()\r\n    {\r\n        // Arrange\r\n        var input = \u0022NOPQRSTUVWXYZABCDEFGHIJKLM\u0022;\r\n        int key = 13;\r\n        string expected = \u0022ABCDEFGHIJKLMNOPQRSTUVWXYZ\u0022;\r\n\r\n        // Act\r\n        var result = CaesarEncoder.Decode(input, key);\r\n\r\n        // Assert\r\n        Assert.Equal(expected, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void Decode_AllCharactersInAlphabet_Lowercase()\r\n    {\r\n        // Arrange\r\n        var input = \u0022nopqrstuvwxyzabcdefghijklm\u0022;\r\n        int key = 13;\r\n        string expected = \u0022abcdefghijklmnopqrstuvwxyz\u0022;\r\n\r\n        // Act\r\n        var result = CaesarEncoder.Decode(input, key);\r\n\r\n        // Assert\r\n        Assert.Equal(expected, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void Encode_WithKeyOver52_WrapsCorrectly()\r\n    {\r\n        // Arrange\r\n        var input = \u0022abc\u0022;\r\n        int key = 55; // 52 % 26 = 3 \u2192 plus 55 % 26 = 3 (because 55 = 2*26 \u002B 3 \u2192 key=3)\r\n        string expected = \u0022def\u0022; // shift by 3 \u2192 abc \u2192 def\r\n\r\n        // Act\r\n        var result = CaesarEncoder.Encode(input, key);\r\n\r\n        // Assert\r\n        Assert.Equal(expected, result);\r\n    }\r\n\r\n    [Fact]\r\n    public void Decode_WithKeyOver52_WrapsCorrectly()\r\n    {\r\n        // Arrange\r\n        var input = \u0022def\u0022;\r\n        int key = 55; // Same as 3 mod 26 \u2192 encoding shift was \u002B3 \u2192 decoding with key 55 would decode as -3\r\n        string expected = \u0022abc\u0022;\r\n\r\n        // Act\r\n        var result = CaesarEncoder.Decode(input, key);\r\n\r\n        // Assert\r\n        Assert.Equal(expected, result);\r\n    }\r\n}\r\n","tests":[{"id":"f143564e-49e2-974a-fde2-b60bb7efd411","name":"DeepSeekR10528UnitTests.CaesarEncoderTests.Encode_ValidInputs_ExpectedEncoding","location":{"start":{"line":7,"column":5},"end":{"line":26,"column":6}}},{"id":"5e10be5b-5dde-71b6-8ec4-0c56dc07b5e3","name":"DeepSeekR10528UnitTests.CaesarEncoderTests.Encode_ValidInputs_ExpectedEncoding","location":{"start":{"line":7,"column":5},"end":{"line":26,"column":6}}},{"id":"17661415-0c90-4d6c-60e5-60a57bdfbd37","name":"DeepSeekR10528UnitTests.CaesarEncoderTests.Encode_ValidInputs_ExpectedEncoding","location":{"start":{"line":7,"column":5},"end":{"line":26,"column":6}}},{"id":"aa0a13bf-4121-b85d-c99c-9e6e80b92c27","name":"DeepSeekR10528UnitTests.CaesarEncoderTests.Encode_ValidInputs_ExpectedEncoding" ming\\Projects\\LlmUnitTestGenerationArtifacts\\DeepSeekR10528UnitTests\\Sample2Tests.cs":{"language":"cs","source":"using Dataset.Sample2;\r\nusing NSubstitute;\r\n\r\nnamespace DeepSeekR10528UnitTests;\r\n\r\npublic class EmployeeServiceTests\r\n{\r\n    private readonly IEmployeeRepository _employeeRepositorySubstitute;\r\n    private readonly EmployeeService _employeeService;\r\n\r\n    public EmployeeServiceTests()\r\n    {\r\n        _employeeRepositorySubstitute = Substitute.For\u003CIEmployeeRepository\u003E();\r\n        _employeeService = new EmployeeService(_employeeRepositorySubstitute);\r\n    }\r\n\r\n    [Fact]\r\n    public async Task GetAsync_ExistingId_ReturnsMappedEmployeeModel()\r\n    {\r\n        // Arrange\r\n        var id = 1;\r\n        var employeeEntity = new EmployeeEntity\r\n        {\r\n            Id = id,\r\n            FirstName = \u0022John\u0022,\r\n            LastName = \u0022Doe\u0022,\r\n            MiddleName = \u0022M\u0022,\r\n            BirthDate = new DateTime(1980, 1, 1),\r\n            Country = \u0022USA\u0022,\r\n            City = \u0022New York\u0022,\r\n            Address = \u0022123 Main St\u0022,\r\n            Phone = \u0022\u002B1234567890\u0022,\r\n            HireDate = new DateTime(2020, 1, 1),\r\n            Salary = 50000,\r\n            DepartmentId = 1,\r\n            Department = \u0022IT\u0022,\r\n            PositionId = 1,\r\n            Position = \u0022Developer\u0022\r\n        };\r\n        _employeeRepositorySubstitute.GetAsync(id).Returns(employeeEntity);\r\n\r\n        // Act\r\n        var result = await _employeeService.GetAsync(id);\r\n\r\n        // Assert\r\n        Assert.Equal(employeeEntity.Id, result.Id);\r\n        Assert.Equal(employeeEntity.FirstName, result.FirstName);\r\n        Assert.Equal(employeeEntity.LastName, result.LastName);\r\n        Assert.Equal(employeeEntity.MiddleName, result.MiddleName);\r\n        Assert.Equal(employeeEntity.BirthDate, result.BirthDate);\r\n ntity\u003E\r\n        {\r\n            new EmployeeEntity { Id = 1, FirstName = \u0022John\u0022 }\r\n        };\r\n        _employeeRepositorySubstitute.ListAsync().Returns(employeeEntities);\r\n\r\n        // Act\r\n        var result = await _employeeService.ListFilteredAsync(\r\n            \u0022\u0022, \u0022\u0022, \u0022\u0022, 0, 0, 0, 0);\r\n\r\n        // Assert\r\n        await _employeeRepositorySubstitute.Received(1).ListAsync();\r\n        await _employeeRepositorySubstitute.DidNotReceive().ListFilteredAsync(Arg.Any\u003Cstring\u003E(), Arg.Any\u003Cstring\u003E(), Arg.Any\u003Cstring\u003E(), Arg.Any\u003Cdecimal\u003E(), Arg.Any\u003Cdecimal\u003E(), Arg.Any\u003Cint\u003E(), Arg.Any\u003Cint\u003E());\r\n        Assert.Single(result);\r\n    }\r\n\r\n    [Fact]\r\n    public async Task ListFilteredAsync_SomeFiltersProvided_CallsRepositoryListFilteredAsync()\r\n    {\r\n        // Arrange\r\n        var employeeEntities = new List\u003CEmployeeEntity\u003E\r\n        {\r\n            new EmployeeEntity { Id = 1, FirstName = \u0022John\u0022 }\r\n        };\r\n        _employeeRepositorySubstitute.ListFilteredAsync(\r\n            \u0022John\u0022, \u0022USA\u0022, \u0022NY\u0022, 50000, 100000, 1, 1).Returns(employeeEntities);\r\n\r\n        // Act\r\n        var result = await _employeeService.ListFilteredAsync(\r\n            \u0022John\u0022, \u0022USA\u0022, \u0022NY\u0022, 50000, 100000, 1, 1);\r\n\r\n        // Assert\r\n        await _employeeRepositorySubstitute.Received(1).ListFilteredAsync(\r\n            \u0022John\u0022, \u0022USA\u0022, \u0022NY\u0022, 50000, 100000, 1, 1);\r\n        Assert.Single(result);\r\n    }\r\n\r\n    [Fact]\r\n    public async Task AddAsync_ValidModel_ReturnsIdAfterValidationAndMapping()\r\n    {\r\n        // Arrange\r\n        var validModel = new EmployeeModel\r\n        {\r\n            FirstName = \u0022John\u0022,\r\n            LastName = \u0022Doe\u0022,\r\n            MiddleName = \u0022M\u0022,\r\n omposition()\r\n    {\r\n        // Arrange\r\n        var matrix = new double[2, 2] { { 4, 3 }, { 6, 3 } };\r\n        double[,] expectedL = { { 1, 0 }, { 1.5, 1 } };\r\n        double[,] expectedU = { { 4, 3 }, { 0, -1.5 } };\r\n\r\n        // Act\r\n        var (l, u) = _lu.Decompose(matrix);\r\n\r\n        // Assert\r\n        Assert.Equal(expectedL[0, 0], l[0, 0]);\r\n        Assert.Equal(expectedL[0, 1], l[0, 1]);\r\n        Assert.Equal(expectedL[1, 0], l[1, 0]);\r\n        Assert.Equal(expectedL[1, 1], l[1, 1]);\r\n        Assert.Equal(expectedU[0, 0], u[0, 0]);\r\n        Assert.Equal(expectedU[0, 1], u[0, 1]);\r\n        Assert.Equal(expectedU[1, 0], u[1, 0]);\r\n        Assert.Equal(expectedU[1, 1], u[1, 1]);\r\n    }\r\n\r\n    [Fact]\r\n    public void Eliminate_MatrixIsNotSquare_ThrowsArgumentException()\r\n    {\r\n        // Arrange\r\n        var nonSquareMatrix = new double[2, 3];\r\n        var coefficients = new double[2];\r\n\r\n        // Act \u0026 Assert\r\n        Assert.Throws\u003CArgumentException\u003E(() =\u003E _lu.Eliminate(nonSquareMatrix, coefficients));\r\n    }\r\n\r\n    [Fact]\r\n    public void Eliminate_1x1System_ReturnsCorrectSolution()\r\n    {\r\n        // Arrange\r\n        var matrix = new double[1, 1] { { 2 } };\r\n        var coefficients = new double[] { 8 };\r\n        var expectedSolution = new double[] { 4 };\r\n\r\n        // Act\r\n        var solution = _lu.Eliminate(matrix, coefficients);\r\n\r\n        // Assert\r\n        Assert.Equal(expectedSolution[0], solution[0]);\r\n    }\r\n\r\n    [Fact]\r\n    public void Eliminate_2x2System_ReturnsCorrectSolution()\r\n    {\r\n        // Arrange\r\n        var matrix = new double[2, 2] { { 3, 1 }, { 1, 2 } };\r\n        var coefficients = new double[] { 9, 8 };\r\n        var expectedSolution = new double[] { 2, 3 };\r\n\r\n        // Act\r\n        var solution = _lu.Eliminate(matrix, coefficients);\r\n\r\n        // Assert\r\n        Assert.Equal(expectedSolution[
